import React from 'react';
import './App.css';
import IconButton from '@material-ui/core/IconButton';
import HighlightOffIcon from '@material-ui/icons/HighlightOff';
import AddCircleOutlineIcon from '@material-ui/icons/AddCircleOutline';
import RemoveCircleOutlineIcon from '@material-ui/icons/RemoveCircleOutline';

class Cart extends React.Component {
  render() {
    return (
            <tr>
            <td>{this.props.name}</td>
            <td>{"$" + this.props.price}</td>
            <td><IconButton onClick={() => this.props.handleRemove(this.props.name)}>
                <RemoveCircleOutlineIcon/>
                </IconButton>
                {this.props.count}
                <IconButton onClick={() => this.props.handleAdd({name: this.props.name, price: this.props.price, count: (this.props.count + 1)})}><AddCircleOutlineIcon/></IconButton></td>
            <td><IconButton onClick={() => this.props.handleRemove(this.props.name)}><HighlightOffIcon/></IconButton></td>
            </tr>
    )
  }
}

export default Cart;
